import React from "react";
import "./components/YearsList.css";
import NavBar from "../../../../../desktop/modules/layout/navBar/NavBar";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faGraduationCap} from "@fortawesome/free-solid-svg-icons";
import LoginContainer from "../../../../../desktop/modules/login/components/LoginContainer";

class YearsListContainer extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            years:[
                {id:1,yearFrom:2019,yearTo:2020},
                {id:2,yearFrom:2019,yearTo:2020},
                {id:3,yearFrom:2019,yearTo:2020},
                {id:4,yearFrom:2019,yearTo:2020},
                {id:5,yearFrom:2019,yearTo:2020},
            ]
        };

    }

    render() {
        return (
            <div className="form">
                    <LoginContainer
                        password={2}
                        username={3}
                        request={4}
                        error={2}
                        handleChange={this.handleChange}
                        handleSubmit={this.handleSubmit}
                    />
                </div>

        );
    }
}

YearsListContainer.propTypes = {};

export default YearsListContainer;
